Description of 
holotype
(ZSI-CZRC-6403).

(
Figure 3
; 
Table 3
). A medium sized snake (maximum recorded TL 
1237 mm
), ochre-brown dorsum speckled with black dots, brick-red ventral scales, tail 32.4% of the TL. Specimen partially dehydrated; 
7 cm
longitudinal ventral incision into coelom at 
500 mm
from snout tip. Body subtriangular, slightly flatten on venter, widest at midbody, gently tapering anteriorly and sharply tapering posteriorly; tail much more strongly tapered; head broader (
11.9 mm
) than tall (
7.9 mm
), distinctly wider than neck.

In dorsal view, head elongate and triangular anterior to eye, ends with an elongated dermal appendage; temporal region gently converging posteriorly; in lateral view, head steeply tapering downwards from eye to nostril; scales on top of head smooth, abutting along midline rather than imbricate/overlapping. Length of dermal appendage smaller (
2.1 mm
) than horizontal eye diameter (
4.7 mm
) and 6% of head length (HL 34.0 mm); canthus rostral is prominent; nostrils situated anteriorly to snout, closer to snout than eye (EN 
7.1 mm
, NS 
6.2 mm
); nasals elongate and roughly lanceolate (
6.1 mm
), nostril squarish located on posterior end of nasal scale; frontal rhomboidal, longer than wide, wider anteriorly (FL 
7.9 mm
, FW 
4.5 mm
); parietals longer than supraocular, smaller than frontal scale and longer than prefrontals (PAL 
7.1 mm
, SOL 
6.1 mm
); left supraocular tapering down completely touching first temporal, on the right supraocular not touching the first temporal; PrF length almost equal to IN (PrFL 
4.9 mm
, INL 
5.1 mm
). One preocular and two presuboculars, lower right presubocular smaller than postocular; left postocular smaller than both presuboculars.
